import React, { useState } from 'react';
import './users.css';

function Users() {
  const [users, setUsers] = useState([]);
  const [showForm, setShowForm] = useState(false);
  const [editUser, setEditUser] = useState(null);

  const addUser = (event) => {
    event.preventDefault();
    // ...
  };

  const toggleForm = () => {
    if (editUser) {
      setEditUser(null);
    } else {
      setShowForm(!showForm);
    }
  };

  const goBack = () => {
    setShowForm(false);
  };

  const handleEditUser = (user) => {
    setEditUser(user);
    setShowForm(true);
  };

  const handleSaveUser = (editedUser) => {
    setUsers((prevUsers) =>
      prevUsers.map((user) => {
        if (user === editUser) {
          return {
            ...user,
            ...editedUser,
          };
        }
        return user;
      })
    );

    setEditUser(null);
  };

  const handleSubmit = (event) => {
    event.preventDefault();

    if (editUser) {
      handleSaveUser(event);
    } else {
      addUser(event);
    }
  };

  return (
    <div className="user-form2">
      <h1 className="heading">Users</h1>
      {showForm || editUser ? (
        <form className="form-container1" onSubmit={handleSubmit}>
          <div className="columns-container1">
            <div className="column1">
              <div className="row">
                <label htmlFor="username">
                  Username<span className="requiredfield">*</span>
                </label>
              </div>
              <div className="row">
                <input
                  type="text"
                  id="username"
                  required
                  name="username"
                  placeholder="Username"
                  value={editUser ? editUser.username : ''}
                  onChange={handleInputChange}
                />
              </div>
              {/* Rest of the form fields */}
            </div>
            {/* Rest of the form fields */}
          </div>
          <div className="form-buttons-container1">
            <button className="form-submit-button1">
              {editUser ? 'Save' : 'Add User'}
            </button>
            <button className="back-button" onClick={goBack}>
              Back
            </button>
          </div>
        </form>
      ) : (
        <div className="user-form2">
          <div className="columns-container">
            <table>
              <thead>
                <tr>
                  <th colSpan="4">User Details</th>
                  <th>
                    <button onClick={toggleForm}>Add a User</button>
                  </th>
                </tr>
                <tr>
                  <th>Username</th>
                  <th>Email</th>
                  <th>Phone No.</th>
                  <th>Role</th>
                  <th>Action</th>
                </tr>
              </thead>
              <tbody>
                {users.map((user) => (
                  <tr key={user.username}>
                    <td>{user.username}</td>
                    <td>{user.email}</td>
                    <td>{user.phone}</td>
                    <td>{user.role}</td>
                    <td>
                      <button onClick={() => handleEditUser(user)}>Edit</button>
                    </td>
                  </tr>
                ))}
              </tbody>
            </table>
          </div>
        </div>
      )}
    </div>
  );
}

export default Users;
